import React, { useEffect, useState } from "react";

function CoinCourse() {
  const [answer, setAnwser] = React.useState([]);

    useEffect(() => {
        fetch("https://www.cbr-xml-daily.ru/daily_json.js")
        .then(response => response.json())
        .then(answer => setAnwser(answer))
    }, []);
    return (
        <div>
          <ul>
            {answer && answer.map((item, index) => <li key={index}>{item.Value} рублей</li>)}
          </ul>
        </div>
      );
}
export default CoinCourse;
